        },
        {
            id: 'e2',
            title: 'Current Bill',
            amount: 111.00,
            date: new Date(2022, 1, 7),
        },
        {
            id: 'e3',
            title: 'House Rent',
            amount: 720.00,
            date: new Date(2022, 1, 14),
        },
        {
            id: 'e4',
            title: 'Water Bill',
            amount: 30,
            date: new Date(2022, 1, 17),
        },
    ]
}

export default expenses;
